import './App.css';
import BudgetCalculator from './BudgetCalculator.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
              <h1>BSU In-Patient Nurse Staffing Simulator</h1>
      </header>
      <BudgetCalculator />
    </div>

  );
}

export default App;
